export const messages = {
    'zh': {
        i18n: {
            breadcrumb: '使用说明',
            tips: '通过切换语言按钮，来改变当前内容的语言。',
            btn: '切换英文',
            title1: '使用步骤',
            p1: '测试用语句，简单说明本工程使用方式:',
            p2: '由终端进入根目录下，使用npm install安装依赖;',
            p3: '安装完毕后，使用npm run dev命令即可运行。',
            title2: '组件插值',
            info: 'Element组件需要国际化，请参考 {action}。',
            value: '文档'
        }
    },
    'en': {
        i18n: {
            breadcrumb: 'International Products',
            tips: 'Click on the button to change the current language. ',
            btn: 'Switch Chinese',
            title1: 'Using steps',
            p1: "Test statement, simple description of the use of the project:",
            p2: "Enter the root directory from the terminal, and use npm install to install the dependency. ",
            p3: "After installation, use npm run dev command to run.",
            title2: 'Component interpolation',
            info: 'The default language of Element is Chinese. If you wish to use another language, please refer to the {action}.',
            value: 'documentation'
        }
    }
}
